import React, {Component} from 'react';
import user_service from './services/user';

class App extends Component{
    constructor(props){
        super(props);
    }

    componentDidMount(){
        console.log('COMPONENT DID MOUNTED')
        user_service.createUser({
            username: 'dani', 
            password: 'dani123', 
            firstName: 'Daniela', 
            lastName: 'Osorto', 
            email: 'daniela@gmail.com', 
            id: '98765', 
            phone: '97933394'
        });
    }
    render(){
        return (<div>HOLA MANUEL</div>);
    }
}

export default App;
